import './App.css';
import * as React from 'react';
import TextField from './Component/TextField.';

function App() {
  return (
    <div>
      <TextField name="Akshay" />
      <TextField name="Aashlesha" />
      <TextField name="Darshani" />
    </div>
  );
}

export default App;
